from pydantic import BaseModel
from typing import Optional


class Token(BaseModel):
    id: int
    address: str = "0x000"
    name: str = "safemoon"
    symbol: str = "SAFEMOON"
    age: int = 1223432
    decimals: int = 18
    logo: Optional[bytes]


token_ = Token(id=1)
token_.logo = b""

print(token_)
